text:
todavía no lo puedo creer, recién escuché la denuncia que se hizo públicamente y escuché todo lo que sufriste, y que mantuviste en silencio hasta hoy

@soythelmafardin sos una mujer increíble, mantener el silencio y salir a contar todo así hoy lo reafirma, sabes que te quiero mucho y siempre voy a estar con vos para lo que necesites. celebro tu valentía amiga

soy hombre, tengo 30 años y no entiendo como puede existir hombres tan hijos de puta como este. ojalá se haga justicia y esa justicia te deje un poco de paz y tranquilidad para el futuro

